script: |
  super -f text -I q10851.spq | sort > q10851.out

inputs:
  - name: q10851.spq
    data: |
      SELECT DISTINCT + 22 FROM tab0 (FORMAT parquet) WHERE 49 NOT BETWEEN col0 + - col1 * + - col0 * + col0 - + - 23 AND - - col1;
  - name: tab0

outputs:
  - name: q10851.out
    data: |
      22
